// la razon de por que comento el codigo es porque es todo nuevo y se me hace mas facil su funcionamiento asi :)


import React from 'react';
import { Col, Row, Card, Typography, List } from 'antd';
import Navbar from '../components/Navbar';
import FooterComponent from '../components/footer'; 

// Importación de imágenes
import bannerNos from '../img/nosotros.png';
import sala from '../img/sala.jpg';
import santi from '../img/ñaez.png';
import rebe from '../img/rebe.png';
import mile from '../img/mile.png';
import alejo from '../img/alejo.png';
import agus from '../img/agustin.png';
import mascota from '../img/mascota.jpg';

const { Title, Paragraph } = Typography;

function SobreNosotros() {
  const razonesParaElegirnos = [
    "Proyecciones de alta calidad",
    "Sonido envolvente",
    "Ambiente acogedor",
    "Variedad de snacks",
    "Eventos especiales y maratones",
  ];

  return (
    <div>
      <Row>
        <Col xs={24}>
          <Navbar />
        </Col>
      </Row>
      <Row>
        <Col xs={24}>
          <div>
            <img src={bannerNos} alt="Banner" style={{ width: '100%' }} />
          </div>
        </Col>
      </Row>
      <Row justify="center" style={{ padding: '40px 0' }}>
        <Col xs={24} md={20}>
          <div style={{ padding: '16px', background: 'white', borderRadius: '8px' }}>
            <Row gutter={[16, 16]}>
              <Col xs={24} md={12}>
                <img src={sala} alt="Sala de cine" style={{ width: '100%', height: '75%' , borderRadius: '8px' }} />
              </Col>
              <Col xs={24} md={12}>
                <Title level={3}>Nuestra Historia</Title>
                <Paragraph style={{ fontSize: '16px', lineHeight: '1.6' }}>
                  Nuestro Cine Retro nació en el corazón de la ciudad con el objetivo de traer de vuelta la nostalgia de las películas clásicas de los años 2000/90/80.
                  Desde comedias icónicas hasta épicos de acción, nuestro cine ofrece una experiencia única para los amantes de obras de todas las edades.
                </Paragraph>
                <Title level={4}>¿Por Qué Elegirnos?</Title>
                <List
                  bordered
                  dataSource={razonesParaElegirnos}
                  renderItem={item => (
                    <List.Item>
                      {item}
                    </List.Item>
                  )}
                />
              </Col>
            </Row>
          </div>
        </Col>
      </Row>

      {/* Sección Nuestro Equipo */}
      <Row justify="center" style={{ padding: '10px 0' }}>
        <Col xs={24} md={20}>
          <Title level={2} style={{ textAlign: 'center' }}>Nuestro Equipo</Title>
          <Row gutter={[16, 16]} justify="center">
            {[
              { img: santi, nombre: "Santiago Baez", puesto: "Director General" },
              { img: mile, nombre: "Milena Sivit", puesto: "Gerente de Operaciones" },
              { img: rebe, nombre: "Rebeca López", puesto: "Jefa de Proyecciones" },
              { img: alejo, nombre: "Alejo Pinatti", puesto: "Jefe de Finanzas" },
              { img: agus, nombre: "Agustin Fasano", puesto: "Programador" },
              { img: mascota, nombre: "Pop Corn", puesto: "Mascota del cine" },
            ].map((persona, index) => (
              <Col key={index} xs={24} sm={12} md={8} lg={4}>
                <Card style={{ textAlign: 'center', border: 'none' }} bodyStyle={{ padding: 0 }}>
                  <div className="team-member">
                    <img src={persona.img} alt={persona.nombre} className="team-img" />
                    <Title level={4}>{persona.nombre}</Title>
                    <Paragraph>{persona.puesto}</Paragraph>
                  </div>
                </Card>
              </Col>
            ))}
          </Row>
        </Col>
      </Row>

      <FooterComponent />

      {/* Estilos adicionales */}
      <style jsx>{`
        .team-member {
          transition: transform 0.3s ease;
        }
        .team-member:hover {
          transform: translateY(-10px);
        }
        .team-img {
          width: 150px;
          height: 150px;
          border-radius: 50%;
          object-fit: cover;
          margin-bottom: 16px;
          transition: transform 0.3s ease;
        }
        .team-member:hover .team-img {
          transform: scale(1.1);
        }
      `}</style>
    </div>
  );
}

export default SobreNosotros;
